import React, { useState } from 'react'
import { Form } from "semantic-ui-react";
import { useFormik } from "formik";
import { initialValues } from "./RegisterForm.form";
import "./RegisterForm.scss";

export function RegisterForm() {
const [error, setError] =  useState("");

const  formik = useFormik({
    initialValues: initialValues(),
    onSubmit: async ( formValue ) => {
        try {
            console.log(formValue);
        } catch {
            console.error(error);
        }
    },
});

  return (
    <Form  className='register-form' onSubmit={formik.handleSubmit}>
        <Form.Input 
            name="email"  
            placeholder="E-mail" 
        />
        <Form.Input 
        name="password"  
        type="password"  
        placeholder="Senha" />
        <Form.Input name="repeatPassword" type="password" placeholder="Confirmar senha" />
        <Form.Checkbox name="conditionsAccepted" label="Li e aceito as polÃ­ticas de privacidade" />
        <Form.Button type="submit"  primary fluid>Criar Conta</Form.Button>
        <p className='register-form__error'>{ error }</p>
    </Form>
  )
}
